    //노래 예약시 한 번만 작동, URL 포함
    public void addURL(VRCUrl url)
    {
        if (_add == "" && !_isPlaying)
        {
            _add = "force";
            Debug.Log("에케 디버그: addURL: _add: force");
        }

        switch (_add)
        {
            case "first":
                Debug.Log("에케 디버그: addURL: 우선예약: " + url);
                wolfeQueueController.addSongPriority(url);
                _input = "FQueue";
                break;
            case "force":
                Debug.Log("에케 디버그: addURL: 즉시재생: " + url);
                wolfePlayerController.LoadUrl(url);
                _input = "Play";
                break;
            default:
                Debug.Log("에케 디버그: addURL: 예약: " + url);
                wolfeQueueController.AppendToQueue(url);
                _input = "Queue";
                break;
        }
        _add = String.Empty;
        RequestSerialization(); //Udon 동기화
        return;
    }

    public void Enter() //예약 버튼
    {
        Debug.Log("에케 디버그: Enter");
        string _now = _input;
        _input = String.Empty;

        int check;
        bool checkr = Int32.TryParse(_now, out check);

        //숫자가 아니면
        if (!checkr)
        {
            _input = "Notnum";
            return;
        }

        switch (_now)
        {
            case "1015":    //초기화 코드
                _input = "Reset";
                _vote = 3;
                _add = String.Empty;
                RequestSerialization();
                Debug.Log("에케 디버그: Enter: 초기화");
                wolfeQueueController.ClearQueue();
                break;
            case "08":  //즉시재생모드
                Debug.Log("에케 디버그: Enter: 즉시재생 활성화");
                _add = "force";
                _input = "P!";
                break;
            case "00":  //우선예약가능모드
                Debug.Log("에케 디버그: Enter: 우선예약 활성화");
                _add = "first";
                _input = "FQ!";
                break;
            default:
                Debug.Log("에케 디버그: Enter: 예약발신: " + _now);
                Request(_now);
                break;
        }
        RequestSerialization(); //Udon 동기화
        return;
    }

