    public void Vote() //넘기기 버튼
    {
        Debug.Log("에케 디버그: Vote: Skip Vote +1");
        _vote--;
        vote_text.text = $"({_vote})";

        if (_vote == 0) //넘기기가 3개면
        {
            _input = "Skip";
            _vote = 3;
            vote_text.text = $"({_vote})";
            Debug.Log("에케 디버그: Vote: Skip Video");
            wolfeQueueController.SkipCurrentVideo();
        }
        RequestSerialization(); //Udon 동기화
    }

